function ReceivedBubble({ReceivedMessage}) {
    return (
        <div className="flex justify-end ml-20 mr-2 p-1 text-base font-light">
            <div className="my-4 p-6  bg-cyan-600 rounded-xl bg-gray-300 text-white">
                <p>{ReceivedMessage}</p>
            </div>

        </div>
    )
}

